import { useEffect } from "react";

const StockItem = (item) => {
    const {costUpdateAt, count, createdAt,dep,name,number,origin,price,size,type,unit} = item.item;
    
   
    return(
        <div>
            <div>
                {number}
            </div>
            <div>
                {origin}
            </div>
            <div>
                {name}
            </div>
            <div>
                {size}
            </div>
            <div>
                {count}
            </div>
            <div>
                {unit}
            </div>
            {name}
        </div>
    )
}

export default StockItem;
